import {useContext} from "react";
import {AuthContext} from "./Authenticator";
import SignIn from "./SignIn";

export const SignOut = () => {
    const {setUserName, setUserEmail} = useContext(AuthContext);
    setUserName("");
    setUserEmail("");
}

export default SignIn;
